- input: "TEXT\x1CC00369181\x1C.TEXT\x1C\x1CF3XA\x1CNo salary expense was paid during
    this reporting period to any employeee who spent more than 25% of their time on
    activities connected to a federal election.  Therefore, no salary expense was
    required to be reported on Line 30b.  All salary expense, however, was paid 100%
    from federal account funds and was properly reported on Line 21b, even though
    it could properly have been allocated on H4.  The Stars of Texas 2008 expense
    on 9/19/08 for $1500 was corrected to show the proper federal/non-federal fundraising
    event allocation percent  distribution.  It was accidentally left at 100% federal
    on the original reports.\n"
